import { useNavigate } from 'react-router-dom';

const inspections = [
  { title: 'Canteen Inspection', formPath: '/form/canteen' },
  { title: 'Fuel Storage Tank Inspection Checklist', formPath: '/form/fuel' },
  { title: 'Hand and Power Tool Inspection Form', formPath: '/form/hand-and-power' },
  { title: 'PPE Inspection Form', formPath: '/form/ppe' },
  { title: 'Science Laboratory Inspection Form', formPath: '/form/science-laboratory' },
  { title: 'Swimming Pool Inspection Checklist', formPath: '/form/swimming-pool' },
  { title: 'Vehicle Inspection Form', formPath: '/form/vehicle' },
];

export default function InspectionDashboard() {
  const navigate = useNavigate();

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-6">Inspection Forms</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
        {inspections.map((item, idx) => (
          <div
            key={idx}
            onClick={() => navigate(item.formPath)}
            className="cursor-pointer border border-gray-300 p-5 rounded-md shadow-md hover:bg-primary hover:text-white transition duration-200"
          >
            <h2 className="text-lg font-semibold">{item.title}</h2>
          </div>
        ))}
      </div>
    </div>
  );
}
